import React from "react";
import { FiMail } from "react-icons/fi";

const CallToAction = () => {
  return (
    <div
      className="rn-callto-action clltoaction-style-default style-2 bg_image bg_image_fixed"
      style={{ backgroundImage: `url(/images/timeline/subs1.jpg)` }}
      data-black-overlay="8"
    >
      <div className="container row">
        <div className="col-lg-4 col-xl-4 col-4 ">
          <div className="thumbnail image-left-content">
            <img
              src="./images/ihelplogo/magazineW1.png"
              alt="banner123"
              style={{
                paddingLeft: "50px",
              }}
            />
          </div>
        </div>
        <div className="row row--30 align-items-center">
          <div className="col-lg-8 offset-lg-1">
            <div className="inner">
              <div className="content text-center">
                <h2 className="title mb--0"> Маркетер танд зориулав</h2>
                <p>
                  Танд болон таны бизнест хэрэгтэй маркетингийн сонирхолтой
                  боломж болон саналуудыг цаг алдалгүй хүлээн аваарай
                </p>
                <form
                  className="blog-search"
                  action="#"
                  // onSubmit={handleAddMagazineSubs}
                >
                  <input
                    type="text"
                    name="name"
                    // onChange={handleAddMagazineSubmit}
                    placeholder="И-мэйл хаягаа бичнэ үү  "
                  />
                  <button className="search-button " type="submit">
                    <FiMail />
                  </button>
                </form>
              </div>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};
export default CallToAction;
